li&gt; number of tasks: 14410 &lt;/li&gt;\n         \n&lt;li&gt; compute time: 9.31 s &lt;/li&gt;\n&lt;li&gt; disk-read time: 130.60 ms &lt;/li&gt;\n&lt;li&gt; transfer time: 1.65 s &lt;/li&gt;\n        &lt;/ul&gt;\n\n        &lt;h2&gt; Scheduler Information &lt;/h2&gt;\n        &lt;ul&gt;\n          &lt;li&gt; Address: tcp://127.0.0.1:56087 &lt;/li&gt;\n          &lt;li&gt; Workers: 10 &lt;/li&gt;\n          &lt;li&gt; Threads: 20 &lt;/li&gt;\n          &lt;li&gt; Memory: 17.18 GB &lt;/li&gt;\n        &lt;/ul&gt;\n\n        &lt;h2&gt; Calling Code &lt;/h2&gt;\n        &lt;pre&gt;\ndef main():\n    client = Client(n_workers=10)\n\n    #print(\"create dataframe\")\n    df = dask.datasets.timeseries(\n        start=\"2000-01-01\",\n        end=\"2000-01-31\",\n        # end=\"2000-12-31\",\n        partition_freq=\"1h\",\n        freq=\"60s\",\n    )\n    df = df.persist()\n    wait(df)\n    iterations = 10\n\n    with performance_report(filename=f\"{today}-simple-scheduler.html\"):\n        simple = []\n        # print('start simple: ', flush=True)\n        for i in range(iterations):\n            start = time.time()\n            z = df.x + 1 + 2 - df.y\n            z.sum().compute()\n            stop = time.time()\n            simple.append(stop - start)\n        simple = np.array(simple)\n\n    df2 = None\n    with performance_report(filename=f\"{today}-shuffle-scheduler.html\"):\n        shuffle_t = []\n        # print('start shuffle: ', flush=True)\n        for i in range(iterations):\n            client.cancel(df2)\n            start = time.time()\n            # shuffle(df, \"id\", shuffle=\"tasks\")\n            df2 = df.set_index(\"id\").persist()\n            wait(df2)\n            stop = time.time()\n            shuffle_t.append(stop - start)\n        shuffle_t = np.array(shuffle_t)\n\n    with performance_report(filename=f\"{today}-rand-access-scheduler.html\"):\n        rand_access = []\n        for i in range(iterations):\n            start = time.time()\n            df2.head()\n            stop = time.time()\n            rand_access.append(stop - start)\n        rand_access = np.array(rand_access)\n    return dict(simple=simple, shuffle=shuffle_t, rand_access=rand_access)\n\n        &lt;/pre&gt;\n        "},"id":"1210","type":"Div"},{"attributes":{"axis":{"id":"1011"},"ticker":null,"visible":false},"id":"1014","type":"Grid"},{"attributes":{"data":{"bandwidth":[],"bandwidth-half":[],"bandwidth_text":[],"type":[]},"selected":{"id":"1276"},"selection_policy":{"id":"1277"}},"id":"1178","type":"ColumnDataSource"},{"attributes":{"base":1024,"mantissas":[1,2,4,8,16,32,64,128,256,512]},"id":"1173","type":"AdaptiveTicker"},{"attributes":{"tabs":[{"id":"1211"},{"id":"1215"},{"id":"1212"},{"id":"1213"},{"id":"1214"},{"id":"1216"},{"id":"1217"}]},"id":"1218","type":"Tabs"},{"attributes":{"formatter":{"id":"1233"},"ticker":{"id":"1016"},"visible":false},"id":"1015","type":"LinearAxis"},{"attributes":{"source":{"id":"1001"}},"id":"1033","type":"CDSView"},{"attributes":{"active_drag":"auto","active_inspect":"auto","active_multi":null,"active_scroll":"auto","active_tap":"auto","tools":[{"id":"1089"},{"id":"1090"},{"id":"1091"},{"id":"1092"},{"id":"1104"}]},"id":"1094","type":"Toolbar"},{"attributes":{},"id":"1040","type":"DataRange1d"},{"attributes":{"callback":null,"point_policy":"follow_mouse","tooltips":"\n            &lt;div&gt;\n                &lt;span style=\"font-size: 14px; font-weight: bold;\"&gt;Name:&lt;/span&gt;&amp;nbsp;\n                &lt;span style=\"font-size: 10px; font-family: Monaco, monospace;\"&gt;@name&lt;/span&gt;\n            &lt;/div&gt;\n            &lt;div&gt;\n                &lt;span style=\"font-size: 14px; font-weight: bold;\"&gt;Filename:&lt;/span&gt;&amp;nbsp;\n                &lt;span style=\"font-size: 10px; font-family: Monaco, monospace;\"&gt;@filename&lt;/span&gt;\n            &lt;/div&gt;\n            &lt;div&gt;\n                &lt;span style=\"font-size: 14px; font-weight: bold;\"&gt;Li
